import React from 'react'

const LevelCard = ({level}) => {
  return (
    <div className='p-4 border-[1px] rounded'>
        <h1 className='text-xl text-indigo-900 font-bold mb-3'> {level.name} </h1><hr/>
        <div className='mt-3 flex'>
          {
            level.classes.map((classe, idx) => (
              <div key={idx} className="bg-slate-700 text-white font-semibold px-4 py-2 rounded-full mx-2">
                {level.name + classe}
              </div>
            ))
          }
        </div>
    </div>
  )
}

export default LevelCard
